INSERT INTO `exercices` (`id`, `name`, `focus`, `video`, `images`, `description`, `conseil`) VALUES
(1, 'Ab Roller', 'Abdominals', 'video/Ab Roller.mp4', 'frontend/img/Ab Roller.jpg', '1- Hold the Ab Roller with both hands and kneel on the floor.\r\n2- Now place the AB roll on the floor in front of you so that you are on all your hands and knees (as in a kneeling position); this will be your starting position.\r\n3- Slowly roll the AB roll straight forward, stretching your body in a straight position. ', '- Descend as far as possible without touching the ground with your body. - Inhale during this part of the movement. - After a pause in the stretched position, begin to return to the starting position by exhaling. - go slow and keep your abs tight at all times.'),
(2, 'Atlas Stone Trainer', 'Lower Back', 'video/Atlas Stone Trainer.mp4', 'frontend/img/Atlas Stone Trainer.jpg', '   This training is effective in developing the strength of the Atlas stone for those who do not have access to the stones, and are usually made from rod ends or heavy pipes:\r\n1- Start by loading the desired weight on the bar.2- Step over the weight, wrap your arms around the tool, bend your hips.\r\n 3- Start by pulling the weight past the knees through the hips. 4- As the weight clears the knees, it can be ground up by resting it on your thighs and sitting down, holding it firmly against your chest. \r\n5- End the movement by stretching your hips and knees to raise the weight as high as possible. 6- The weight can be returned to the lap or floor for repetitions.\r\n', ''),
(3, 'Atlas Stones', 'Lower Back', 'video/Atlas Stones.mp4', 'frontend/img/Atlas Stones.jpg', '1- Start with the atlas stone between your feet.2- Bend over your hips to wrap your arms vertically around the atlas stone, trying to put your fingers under the stone; many stones will have a small flat part on the bottom, which will make the stone easier to hold.\r\n 3- Pulling the stone into your chest, go through the back half of your feet to pull the stone from the ground.\r\n 4- When the stone passes your knees, let it sit back, pulling the stone on top of your thighs.5- Sit low, placing the stone high on your chest as you change your grip to reach the stone. 6- Stand, cross with your hips. 7- Close to the loading platform and lean back, extending the hips to get the stone as high as possible.  \r\n\r\n', NULL),
(4, 'Axle Deadlift', 'Lower Back', 'video/Axle Deadlift.mp4', 'frontend/img/Axle Deadlift.jpg', '1- Approach the bar so that it is centered on your feet; your feet should be about hip width apart. 2- Bend at the hip to grasp the bar shoulder width apart, allowing your shoulder blades to extend. As a general rule, you would use a hand/pocket.\r\n 3- With your feet and grip, breathe a lot, then lower your hips and bend your knees until your shins touch the bar. 4- Look forward with your head, keep your chest high and your back arched, and start driving through the heels to move the weight up.\r\n 5- Once the bar has passed your knees, aggressively pull the bar backwards, pulling your shoulder blades together as you push your hips forward into the bar.\r\n 6- Lower the bar by bending at the hips and guiding it to the ground.', NULL),
(5, 'Ball Leg Curl', 'Hamstrings', 'video/Ball Leg Curl.mp4', 'frontend/img/Ball Leg Curl.jpg', '1- Start on the floor lying on your back with your feet on the ball.\r\n 2- Position the ball so that when your legs are stretched, your ankles are above the ball; this will be your starting position.\r\n 3- Lift your hips off the ground, keeping your weight on your shoulder blades and feet.\r\n 4- Bend your knees by pulling the ball as close as possible to you by contracting the hamstrings.\r\n 5- After a short break, return to the starting position.', NULL),
(6, 'Barbell Curl', 'Biceps', 'frontend/video/Barbell Curl.mp4', 'frontend/img/Barbell Curl.jpg', ' 1- Stand with your torso straight while holding a bar shoulder-width apart; The palm of your hands should be facing forward and elbows should be close to the torso; this will be your starting position.\r\n 2- While holding the upper arms still, bend the weights forward while contracting the biceps when exhaling.\r\n 3- Slowly start moving the bar back to its starting position as you inhale.\r\n 4- Repeat for the recommended amount of repetitions.', '- Only forearms should move.\r\n- Continue the movement until your biceps are fully compressed and the bar is at shoulder level. - Hold tight for one second and tighten the biceps tightly.'),
(7, 'Barbell Lunge', 'Quadriceps', 'video/Barbell Lunge.mp4', 'frontend/img/Barbell Lunge.jpg', '- This exercise is best done inside a squat rack for safety reasons:1- First, place the bar on a grid just below shoulder level; Once the right height is chosen and the bar is loaded.2- Stand under the bar and place the back of your shoulders (slightly under your neck) across.\r\n3- Stand at the bar using both arms on each side and lift it off the support by pushing first with your legs while straightening your torso.\r\n4- Step away from the rack and step forward with your right leg and crouch between your hips, keeping your torso straight and maintaining balance; inhale as you descend. \r\n5- Using mainly the heel of your foot, push up and return to the starting position by exhaling.\r\n6- Repeat the movement for the recommended number of repetitions, then proceed with the left leg.\r\n', '- Do not allow your knee to extend past your toes as this will put excessive pressure on the knee joint.'),
(9, 'Bench Dips', 'Triceps', 'video/Bench Dips.mp4', 'frontend/img/Bench Dips.jpg', 'For this exercise, you will need to place a bench behind your back. With the bench perpendicular to your body and looking away from it, stand at the bench by its edge with hands fully extended, separated at shoulder width: 1- The legs will be extended forward, bent at the waist and perpendicular to your torso; This will be your starting position.\r\n2- Slowly lower your body as you inhale, bending your elbows until you are down enough to have a slightly less than 90 degree angle between the upper arm and forearm. \r\n3- Using your triceps to pull up your torso, return to the starting position.\r\n4- Repeat for the recommended amount of repetitions.', '- Keep elbows as close as possible throughout the movement.\r\n- Forearms should always point down.'),
(10, 'Bodyweight Flyes', 'Chest', 'video/Bodyweight Flyes.mp4', 'frontend/img/Bodyweight Flyes.jpg', '1- Place two equally loaded EZ bars on the floor next to each other; make sure they are capable of rolling.\r\n2- Adopt a push-up position above the bars, supporting your weight on your toes and hands, arms extended and body straight.\r\n3- Place your hands on the bars. This will be your starting position.\r\n4- Using a slow, controlled movement, move your hands away from the centre line of your body, spreading the bars. 5- Inhale during this part of the movement.\r\n6- After moving the bars as far apart as possible, return to the starting position by moving them closer together.7- Exhale as you make this movement.', NULL),
(11, 'Bodyweight Lunge', 'Quadriceps', 'video/Bodyweight Lunge.mp4', 'frontend/img/Bodyweight Lunge.jpg', ' 1- Stand upright with your feet hip-width apart, your chest curved and your shoulders back, maintaining the natural curvature of your spine; your knees should be unlocked and your hand on your hips; this is your starting position.\r\n 2- Step forward moderately with one foot, descending to a point where your back knee approaches the ground without touching it, maintaining your body’s right posture; your front knee must bend to about 90 degrees, but for knee health, it should not be in front of the vertical plane that extends directly from your toes; if so, take a step a little longer.\r\n 3- From the bottom position, push up from your front foot, bringing it back next to each other.\r\n 4- Repeat on the opposite side for the number of repetitions required.', NULL),
(12, 'Bottoms Up', 'Abdominals', 'video/Bottoms Up.mp4', 'frontend/img/Bottoms Up.jpg', '1- Start by lying on your back on the ground; your legs should be straight and your arms at your side; this will be your starting position.\r\n2- To perform the movement, tuck your knees towards your chest by bending your hips and knees. 3- Then extend your legs directly above you so that they are perpendicular to the ground. 4- Rotate and raise your pelvis to lift your buttocks off the ground.\r\n5- After a brief pause, return to the starting position.', NULL),
(13, 'Box Squat', 'Quadriceps', 'video/Box Squat.mp4', 'frontend/img/Box Squat.jpg', '- The box squat allows you to crouch down to the desired depth and develop an explosive force in the squat movement:1- Start in a power rack with a box at the appropriate height behind you. \r\n 2- Start by going under the bar and placing it on the back of the shoulders.3- Tighten your shoulder blades together and rotate your elbows forward, trying to bend the bar on your shoulders.4- Remove the bar from the support, creating a tight arch in the bottom of your back, and back to position.5- Place your feet wider to put more emphasis on the back, buttocks, adductors and hamstrings, or bring them closer for more development of quadriceps; Keep the head facing forward.\r\n 6- With your back, shoulders and trunk tight, push your knees and buttocks outward and start your descent.7- Sit with your hips until you are seated on the box; ideally, your shins should be perpendicular to the floor.8- Pause when you reach the box and relax the hip flexors. Never bounce on a box.\r\n 9- Keeping the weight on your heels and pushing your feet and knees outward, step out of the box while directing the movement with your head;1- Continue upward, keeping the seal from head to toe.', '- Generally, you aim for a box height that will take you to a parallel squat, but you can practice higher or lower if you wish.'),
(14, 'Cable Chest Press', 'Chest', 'video/Cable Chest Press.mp4', 'frontend/img/Cable Chest Press.jpg', '1- Adjust the weight to an appropriate amount and sit down while grasping the handles; Your upper arms should be about 45 degrees from the body with the head and chest up; Elbows should be bent about 90 degrees; this will be your starting position.\r\n 2- Start by extending your elbow, pressing the handles together in front of you.3- Keep your shoulder blades retracted while you perform the movement.\r\n4- After a full extension pause, return to the starting position by holding the tension on the cables; you can also perform this back-to-pad movement, tilted or declined, or alternate hands.', NULL),
(15, 'Cable Crossover', 'Chest', 'video/Cable Crossover.mp4', 'frontend/img/Cable Crossover.jpg', '1- To get into the starting position, move the pulleys up (above your head), select the resistance to use and hold the pulleys in each hand.\r\n2- Walk in front of an imaginary straight line between the two pulleys while bringing your arms closer in front of you; Your torso should have a small curvature forward from the waist; this will be your starting position.3- With a slight bending on your elbows to avoid stress on the biceps tendon, extend your arms to the side (right on both sides) in a wide arc until you feel a stretch on your chest.4- Inhale as you perform this part of the movement.\r\n5- Return your arms to the start position when you exhale.6- Make sure you use the same arc of motion used to lower the weights.\r\n7- Hold the start position for one second and repeat the movement for the prescribed number of repetitions.', '- Keep in mind that throughout the movement, the arms and torso should remain stationary; the movement should only occur at the shoulder joint.'),
(16, 'Cable Crunch', 'Abdominals', 'video/Cable Crunch.mp4', 'frontend/img/Cable Crunch.jpg', '1- Kneel under a high pulley that contains a rope tie.\r\n2- Grab the rope tie from the cable and lower the rope until your hands are placed next to your face.\r\n3- Bend your hips slightly and let the weight stretch your lower back; this will be your starting position.\r\n4- With the hips still, bend your waist by contracting the abdominals so that the elbows move towards the middle of the thighs. 5- Exhale while performing this part of the movement and hold the contraction for one second.\r\n6- Slowly breathe back to the starting position. \r\n\r\n7-Repeat for the recommended amount of repetitions.', '- Be sure to maintain constant tension on the abdominals throughout the movement. - Also, don’t choose a truck so heavy that the lower back can handle the heavy work.'),
(17, 'Car Drivers', 'Shoulders', 'video/Car Drivers.mp4', 'frontend/img/Car Drivers.jpg', '1- While standing, hold a dumbbell plate in both hands at 3 and 9 o\'clock positions; your palms must face each other and your arms must be extended in front of you; this will be your starting position.\r\n2-Start the movement by rotating the tray as much as possible to one side.3- Use the same type of movement you would use to turn a steering wheel to one side.\r\n4- Reverse the motion by turning it completely to the opposite side.\r\n5- Repeat for the recommended amount of repetitions.', NULL),
(18, 'Chin-Up', 'Lats', 'video/Chin-Up.mp4', 'frontend/img/Chin-Up.jpg', ' 1- Grasp the pull bar with palms facing your torso and a handle closer than shoulder width.\r\n 2- As you have both arms outstretched in front of you while holding the bar at the chosen grip width, keep your torso as straight as possible while creating a curvature on the bottom of your back and pulling out your chest; this is your starting position. \r\n 3- After one second of biceps compression in the contracted position, slowly lower your torso to the starting position; when your arms are fully extended; Inhale as you perform this part of the movement.\r\n4-  Repeat this motion for the prescribed number of repetitions.\r\n\r\n\r\n', ''),
(19, 'Clean', 'Hamstrings', 'video/Clean.mp4', 'frontend/img/Clean.jpg', '1- With a bar on the ground near the shins, take a pronation grip (or hook) just outside the legs. 2- Lower your hips with the concentrated weight on the heels, back straight, head forward, chest up, shoulders just in front of the bar; this will be your starting position.\r\n\r\n 3- Start the first pull through the heels, extending your knees; The angle of your back should stay the same and your arms should stay straight; Move the weight with control while continuing above the knees.\r\n 4- Then comes the second sweater, the main source of acceleration for the clean; When the bar approaches the mid-thigh position, start to extend through the hips.5- In a jump movement, accelerate by extending the hips, knees and ankles, using speed to move the bar up. \r\n 6- When the full extension is reached, move to the third pull by shrugging your shoulders aggressively and bending your arms with your elbows up and out.7- At the extension peak, pull aggressively down, by turning your elbows under the bar while you are doing so.8- Receive the bar in the forward squat position, the depth of which depends on the bar height at the end of the third pull; The bar must be placed on the extended shoulders, Touch the throat slightly with your hands relaxed.9- Continue descending to the lower squat position, which will help with recovery.\r\n10- Recover immediately by going through the heels, keeping the torso straight and elbows raised; Continue until you are standing.', '- It should not be necessary to actively pull between the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, slightly tilted backwards, arms always extended.'),
(20, 'Clean and Jerk', 'Shoulders', 'video/Clean and Jerk.mp4', 'frontend/img/Clean and Jerk.jpg', '1- To start, lie down on an inclined bench, chest and belly effectively against the slope.2- Have dumbbells in each hand with palms facing each other (neutral grip).\r\n  3- Extend the arms in front of you so that they are perpendicular to the corner of the bench; the legs must be immobile while applying pressure with the soles of the toes; this is the starting position.\r\n  4- Keeping the elbows slightly bent, move the weights away from each other (to the side) in an arc motion while exhaling.\r\n  5- Feel the contraction and slowly lower the weights to the starting position while inhaling.\r\n  6- Repeat for the recommended amount of repetitions.', '- try to tighten your shoulder blades together to get the best results from this exercise.\r\n - Arms should be raised until parallel to the ground.'),
(21, 'Clean and Press', 'Shoulders', 'video/Clean and Press.mp4', 'frontend/img/Clean and Press.jpg', '1- Assume a shoulder-width position with your knees in your arms.2- Now, keeping your back flat, Bend your knees and hips so that you can grasp the bar with your arms fully extended and pronation slightly wider than the width of your shoulders.3- Point your elbows to the sides; the bar should be close to your shins. 4- Place the shoulders above or slightly forward of the bar.5- Establish a flat back position; this will be your starting position.\r\n 6- Start pulling the bar by extending your knees; Move your hips forward and lift your shoulders at the same pace while keeping the angle of your back constant; continue to lift the bar up while keeping it close to your body.\r\n 7- When the bar passes the knee, stretch out forcefully at the ankles, knees and hips, as if for a jump movement; as you do, continue to guide the bar with your hands, by shrugging your shoulders and using the momentum of your movement to pull the bar as high as possible; the bar should move close to your body and you should keep your elbows apart.\r\n8- At maximum elevation, your feet need to clear the ground and you need to start pulling under the bar; The mechanics of this may change slightly, depending on the weight used; You need to get down into squat position when you pull under the bar.\r\n 9- When the bar reaches the terminal height, rotate your elbows around and under the bar. Place the bar on the front of the shoulders while keeping the torso straight and bending the hips and knees to absorb the weight of the bar; Stand at full height, holding the bar in a clean position.\r\n 10- Without moving your feet, press the bar over your head as you exhale; lower the bar under control.', NULL),
(22, 'Clean Deadlift', 'Hamstrings', 'video/Clean Deadlift.mp4', 'frontend/img/Clean Deadlift.jpg', '1- Start standing with a bar near your shins; your feet should be directly under your hips with your feet slightly turned.2- Grasp the bar with a double pronation grip or hook grip, about shoulder width apart.3- Crouch down to the bar; your spine should be fully extended, with a back angle that places your shoulders in front of the bar and your back as vertical as possible.\r\n4- Start by crossing the ground from the front of your heels; When the bar moves upward, keep a constant back angle.5- Spread your knees to the side to keep them out of the bar’s path.\r\n6- Once the bar has crossed the knees, finish the lift by pushing the hips into the bar until your hips and knees are extended.', NULL),
(23, 'Cocoons', 'Abdominals', 'video/Cocoons.mp4', 'frontend/img/Cocoons.jpg', '1- Start by lying on your back on the ground. Your legs should be straight and your arms extended behind your head; this will be your starting position.\r\n2- To make the move, tuck your knees towards your chest, turning your pelvis to lift your buttocks off the ground. 3- While doing so, bend the spine by bringing your arms over your head for a simultaneous cracking motion.\r\n4- After a brief pause, return to the starting position.', NULL),
(24, 'Concentration Curls', 'Biceps', 'video/Concentration Curls.mp4', 'frontend/img/Concentration Curls.jpg', '1- your arm should be extended and the dumbbells should be above the ground; this will be your starting position.\r\n\r\n2- Sit on a flat bench with a dumbbell in front of you between your legs; your legs should be spread apart, knees bent and feet on the ground. 3- Use your right arm to pick up the dumbbells. 4- Place the back of your right arm on the top of your inner right thigh. 5- Rotate the palm of your hand until it is forward away from your thigh. \r\n6- While holding the upper arm still, bend the weights forward while contracting the biceps when you exhale; only the forearms should move. 7- Continue the movement until your biceps are completely contracted and the dumbbells are at shoulder level. \r\n8- Slowly begin to bring the dumbbells back to their starting position as you inhale. \r\n9- Repeat for the recommended amount of repetitions. Then repeat with the left arm.', '- Avoid swinging at any time. At the top of the movement, make sure that the little finger of your arm is higher than your thumb. - This guarantees a good contraction. - Hold the position for one second while tightening the biceps.\r\n'),
(25, 'Deadlift with Bands', 'Lower Back', 'video/Deadlift with Bands.mp4', 'frontend/img/Deadlift with Bands.jpg', '  1- Approach the bar so that it is centered on your feet. Your feet should be about hip width apart. 2- Make sure the strips are under the back half of your foot (for short strips), directly where you drive in the ground.  3- Bend to the hip to grasp the bar shoulder width apart, allowing your shoulder blades to extend. 4- Generally, you would use an overhand handle or an over/under grip on heavier sets. 5- With your feet and your set grip, take a deep breath, then lower your hips and bend your knees until your shins touch the bar. 6- Look forward with your head, keep your chest high and your back arched, and start driving through the heels to move the weight up. \r\n7- Once the bar has passed your knees, aggressively pull the bar backwards, pulling your shoulder blades together as you push your hips forward into the bar. \r\nLower the bar by bending at the hips and guiding it towards the ground.\r\n', '- To lift short strips, simply buckle them on the bar before starting and enter to install them. - For long strips, they should be anchored to a secure base such as a dumbbell or rack.'),
(26, 'Deadlift with Chains', 'Lower Back', 'video/Deadlift with Chains.mp4', 'frontend/img/Deadlift with Chains.jpg', '1- Approach the bar so that it is centered on your feet; your feet should be about hip width apart. 2- Bend to the hip to grasp the bar shoulder width apart, allowing your shoulder blades to extend. \r\n 3- With your feet and your set grip, take a deep breath, then lower your hips and bend your knees until your shins touch the bar. \r\n 4- Look forward with your head, keep your chest high and your back arched, and start driving through the heels to move the weight up. 5- Once the bar has passed your knees, aggressively pull the bar backwards, pulling your shoulder blades together as you push your hips forward into the bar. \r\n6- Lower the bar by bending at the hips and guiding it to the ground.\r\n', '- You can attach the chains to the bar handles, or simply drape the middle on the bar so that there is a greater increase in weight when you lift . - Generally, you would use an overhand handle or an over/under grip on heavier sets.'),
(27, 'Decline Push-Up', 'Chest', 'video/Decline Push-Up.mp4', 'frontend/img/Decline Push-Up.jpg', '1- Lie on the floor face down and place your hands approximately 36 inches while holding your torso at arm’s length. 2- Move your feet to a box or bench. This will be your starting position.\r\n3- Then lower yourself until your chest almost touches the ground when you inhale.\r\n4- Now exhale and press on the top of your body to return to the starting position while squeezing your chest.\r\n5- After a brief pause in the upper contracted position, you can start lowering down again for as many repetitions as necessary.', NULL),
(28, 'Deficit Deadlift', 'Lower Back', 'video/Deficit Deadlift.mp4', 'frontend/img/Deficit Deadlift.jpg', '1- Start by having a platform or weight plates on which you can stand, usually 1 to 3 inches high. 2- Approach the bar so that it is centered on your feet; your feet should be about hip width apart. 3- Bend to the hip to grasp the bar shoulder width apart, allowing your shoulder blades to extend. \r\n 4- With your feet and your set grip, take a deep breath, then lower your hips and bend your knees until your shins touch the bar. 5- Look forward with your head, keep your chest high and your back arched, and start driving through the heels to move the weight up. 6- Once the bar has passed your knees, aggressively pull the bar backwards, pulling your shoulder blades together as you push your hips forward into the bar. 7- Lower the bar by bending at the hips and guiding it to the ground.', '- Generally, you would use an overhand handle or an over/under grip on heavier sets.'),
(29, 'Dip Machine', 'Triceps', 'video/Dip Machine.mp4', 'frontend/img/Dip Machine.jpg', '1- Sit safely in a dipping machine, select the weight and grip the handles firmly.\r\n2- Now, keep your elbows at your side to focus on the triceps; the elbows should be bent at a 90 degree angle.\r\n3- When you contract the triceps, extend your arms down as you exhale.\r\n4- Now, slowly let your arms return to the starting position as you inhale.\r\n5- Repeat for the recommended amount of repetitions.', '- At the bottom of the movement, focus on maintaining a small flexion of the arms to maintain tension on the triceps muscle.'),
(30, 'Drop Push', 'Chest', 'video/Drop Push.mp4', 'frontend/img/Drop Push.jpg', '1- Place low boxes or other platforms 2-3 feet apart.\r\n2- Move to a pump position between them, supporting yourself by placing your hands on the boxes.\r\n3- With good posture, lower the platforms by pressing up and moving your hands shoulder width apart, dampening your landing by absorbing the impact through the arm.', NULL),
(31, 'dumbbells Flyes', 'Chest', 'video/dumbbells Flyes.mp4', 'frontend/img/dumbbells Flyes.jpg', '1- Lie on a flat bench with a dumbbell on each hand resting on the top of your thighs; the palms of your hands will face each other.\r\n 2- Then, using your thighs to help lift the dumbbells, lift the dumbbells one at a time so that you can hold them shoulder width apart with the palms of your hands facing each other.3- Lift the dumbbells as if you were pressing them, but stop and hold them just before locking; this will be your starting position.\r\n 4- With slight bending on your elbows to avoid stress on the biceps tendon, lower your arms on both sides in a wide arc until you feel a stretch on your chest.5- Inhale as you perform this part of the movement.\r\n  6- Bring your arms back to the starting position while contracting your chest muscles and exhaling.\r\n     7- Hold the contracted position for one second and repeat the movement for the prescribed number of repetitions.', '- Keep in mind that throughout the movement, the arms should remain stationary; the movement should only occur at the shoulder joint. \r\n- Be sure to use the same arc of motion used to lower weights.'),
(32, 'dumbbells Squat', 'Quadriceps', 'video/dumbbells Squat.mp4', 'frontend/img/dumbbells Squat.jpg', '1- Stand straight while holding a dumbbell in each hand (palms facing the side of your legs).\r\n2- Position your legs using a medium shoulder width position with slightly pointed toes. 3- Keep your head up at all times, as looking down will unbalance you and also maintain a straight back; this will be your starting position.\r\n4- Start slowly lowering your torso by bending your knees while maintaining a straight posture with your head up. 5- Continue until your thighs are parallel to the ground.\r\n6- Start lifting your torso as you exhale by pushing the ground with the heel of your foot primarily as you straighten your legs and return to the starting position.\r\n7- Repeat for the recommended amount of repetitions.', '- For the purpose of this exercise, we will use the average position described above that targets overall development; however, you can choose one of the three positions described in the foot position section.\r\n- If you have done the exercise correctly, the front of the knees should form an imaginary straight line with the toes perpendicular to the front.\r\n- If your knees go beyond this imaginary line (if they go beyond your toes), you put excessive pressure on the knee and the exercise was not done correctly.'),
(33, 'EZ-Bar Curl', 'Biceps', 'video/EZ-Bar Curl.mp4', 'frontend/img/EZ-Bar Curl.jpg', '1- Stand straight while holding an EZ curl bar on the wide outer handle; the palms of your hands should be facing forward and slightly tilted inwards due to the shape of the bar. 2- Keep your elbows close to your chest. This will be your starting position.\r\n3- Now, while keeping your arms still, exhale and bend the weights forward while contracting the biceps; focus only on moving your forearms.\r\n4- Continue lifting until your biceps are fully squeezed and the bar is at shoulder level. Hold the upper contracted position for a while and tighten the biceps.\r\n5- Then inhale and slowly lower the bar to the starting position.\r\n6- Repeat for the recommended amount of repetitions.\r\n', NULL),
(34, 'EZ-Bar Skullcrusher', 'Triceps', 'video/EZ-Bar Skullcrusher.mp4', 'frontend/img/EZ-Bar Skullcrusher.jpg', '1- Using a firm grip, lift the EZ bar and hold it with your elbows inwards while you lie on the bench; your arms should be perpendicular to the floor; this will be your starting position.\r\n2- Keeping the upper arms still, lower the bar allowing the elbows to flex; Inhale as you perform this part of the movement.3- Pause once the bar is directly above the forehead.\r\n4- Raise the bar to the starting position by extending the elbow and exhaling.\r\n5- Repeat.', NULL),
(35, 'Front dumbbells Raise', 'Shoulders', 'video/Front dumbbells Raise.mp4', 'frontend/img/Front dumbbells Raise.jpg', '1- Pick a few dumbbells and stand with a straight torso and dumbbells on the front of your thighs at arm’s length with the palms of your hand facing your thighs; this will be your starting position.\r\n2- While holding the torso still (no swinging), lift the left dumbbells forward with a slight bend of the elbow and the palms of the hands always facing down.3- Continue climbing until your arm is slightly above the floor parallel.4- Exhale as you perform this part of the movement and pause for a second at the top; Inhale after the second pause.\r\n5- Now slowly lower the dumbbells to the starting position while simultaneously lifting the right dumbbells.\r\n6- Continue to rotate in this manner until all recommended repetitions have been completed for each arm.', NULL),
(36, 'Front Plate Raise', 'Shoulders', 'video/Front Plate Raise.mp4', 'frontend/img/Front Plate Raise.jpg', '1- Standing upright, hold a dumbbell plate in both hands at 3 and 9 o’clock positions; Your palms must face each other and your arms must be stretched out and locked with a slight bending at the elbows and the plate must be down near your waist in front of you as far as you can go; this will be your starting position.\r\n2- Slowly lift the plate as you exhale until it is slightly above shoulder level. Hold the contraction for a second.\r\n3- While inhaling, slowly lower the plate to the starting position.\r\n4- Repeat for the recommended amount of repetitions.', '- Arms will remain in this position throughout the exercise.\r\n- be sure not to swing the weight or bend the elbows. - Your torso should also remain still throughout the movement.'),
(37, 'Glute Ham Raise', 'Hamstrings', 'video/Glute Ham Raise.mp4', 'frontend/img/Glute Ham Raise.jpg', '1- Start by adjusting the equipment to your body. Place your feet against the footrest between the rollers as you lie on your stomach; your knees should be just behind the cushion.\r\n 2- Start at the bottom of the movement. Keep your back arched when you start the movement by bending your knees. 3- Drive your toes into the foot plate while you do it.4- Keep your upper body straight and keep going until your body is straight.\r\n5- Return to the starting position keeping your descent under control.', NULL),
(38, 'Good Morning', 'Hamstrings', 'video/Good Morning.mp4', 'frontend/img/Good Morning.jpg', '1- Start with a bar on a grid at shoulder height.2- Place the bar on the back of your shoulders as you would for a power squat, not on the top of your shoulders.3- Keep your back tight, shoulder blades tight, and knees slightly bent; Step away from the rack.\r\n 4- Start by leaning at the hips, bringing them back when leaning almost parallel.5- Keep your arched back and cervical spine in good alignment.\r\n6- Reverse the movement through the hips with your buttocks and hamstrings.7- Continue until you have returned to the starting position.', NULL),
(39, 'Hammer Curls', 'Biceps', 'video/Hammer Curls.mp4', 'frontend/img/Hammer Curls.jpg', ' 1- Stand with your right torso and dumbbell in each hand held at arm’s length; elbows should be close to the torso.\r\n 2- The palms of the hands must face your torso. This will be your starting position.\r\n 3- Now, while holding your arm still, exhale and bend the weight forward while contracting the biceps. 4- Continue to lift the weight until the biceps are fully squeezed and the dumbbells are at shoulder level. 5- Hold the position for a brief moment while tightening the biceps. \r\n 6- After the brief pause, inhale and slowly start lowering the dumbbells to the starting position.\r\n7- Repeat for the recommended amount of repetitions.', '- focus on holding the elbow still and only move your forearm.'),
(40, 'Hang Clean', 'Quadriceps', 'video/Hang Clean.mp4', 'frontend/img/Hang Clean.jpg', '1- Start with a shoulder width, double pronation or hook grip, with the bar hanging in the middle of the thigh; your back should be straight and slightly tilted forward.\r\n 2- Start by aggressively extending the hips, knees and ankles, pushing the weight upward.As you do, shrug your shoulders towards your ears.3- When the full extension is reached, Move to final pull by shrugging your shoulders aggressively and bending your arms with your elbows up and out.4- At the extension peak, pull aggressively down, turning your elbows under the bar while doing so.5- Receive the bar in forward squat position, the depth of which depends on the height of the bar at the end of the third pull; The bar should be placed on the extended shoulders, touching the throat slightly with the relaxed hands.6- Continue to descend to the lower squat position, which will help with recovery.7- Recover immediately by going through the heels, keeping the torso straight and elbows raised.8- Continue until you are standing.', NULL),
(41, 'Hang Snatch', 'Hamstrings', 'video/Hang Snatch.mp4', 'frontend/img/Hang Snatch.jpg', '1- Start with a wide grip on the bar, pronation or hook; feet should be directly under the hips with feet facing out; your knees should be slightly bent and the torso tilted forward; The spine should be fully extended and the head facing forward; the bar should be at the hips; this will be your starting position.\r\n 2- Lie aggressively across the legs and hips; At the top of the extension, shrug your shoulders and let your elbows bend to the side.\r\n 3- When moving your feet into the landing position, pull forcefully under the bar while raising the bar above your head.4- Receive the bar with your body as low as possible and arms fully extended above your head.\r\n5- Return to standing position with the weight above the head; Follow by bringing the weight back to the floor under control.', NULL),
(42, 'Hanging Pike', 'Abdominals', 'video/Hanging Pike.mp4', 'frontend/img/Hanging Pike.jpg', '1- Kneel under a high pulley that contains a rope tie.\r\n2- Grab the rope tie from the cable and lower the rope until your hands are placed next to your face.\r\n3- Bend your hips slightly and let the weight stretch your lower back; this will be your starting position.\r\n4- With the hips still, bend the waist by contracting the abdominals so that the elbows move towards the middle of the thighs.5- Exhale as you perform this part of the movement and hold the contraction for a second.\r\n6- Slowly breathe back to the starting position. \r\n\r\n  Repeat for the recommended amount of repetitions.', '-  Be sure to maintain constant tension on the abdominals throughout the movement. - Also, don’t choose a truck so heavy that the lower back can handle the heavy work.'),
(43, 'Incline Push-Up', 'Chest', 'video/Incline Push-Up.mp4', 'frontend/img/Incline Push-Up.jpg', '1- Stand facing a sturdy bench or raised platform.2- Place your hands on the edge of the bench or platform, slightly wider than the shoulder width.\r\n3- Place the forefoot back of the bench or platform with the arms and body straight; arms should be perpendicular to the body.4- Keeping the body straight, lower the chest to the edge of the box or platform by folding the arms.\r\n 5- Push the body upward until the arms are extended; repeat.', NULL),
(44, 'Inverted Row', 'Middle Back', 'video/Inverted Row.mp4', 'frontend/img/Inverted Row.jpg', '1- Place a bar in a rack about the height of the waist; you can also use a forging machine.\r\n2- Take a grip wider than shoulder width on the bar and hang under the bar; your body should be straight with your heels on the ground and your arms fully extended; this will be your starting position.\r\n 3- Start by bending your elbow by pulling your chest toward the bar.4- Retract your shoulder blades as you perform the movement.\r\n 5- Pause at the top of the movement and return to the starting position.\r\n 6- Repeat for the desired number of repetitions.', NULL),
(45, 'JM Press', 'Triceps', 'video/JM Press.mp4', 'frontend/img/JM Press.jpg', '1- Load the bar to an appropriate weight for your workout.\r\n2- Lie on the bench with your feet flat on the ground, crossing with your hips; your back should be arched and your shoulder blades retracted.\r\n3- Take a medium pronation grip, covering the rings on the bar; remove the bar from the support by holding the weight above your collarbone with your arms outstretched; this will be your starting position.\r\n4- Lower the bar by moving your elbows forward; the bar should only move vertically, making the exercise look like a hybrid bench press and a skull grinder.\r\n5- Lower the weight but stop before allowing it to touch your chest, then bring the bar back to the starting position.', NULL),
(46, 'Keg Load', 'Lower Back', 'video/Keg Load.mp4', 'frontend/img/Keg Load.jpg', '1- Start by grasping the closed handle of the first drum, tilting it to the side to grab the opposite edge of the bottom of the drum.\r\n2- Lift the drum to your chest.\r\n  3- Make sure you keep a firm grip on the keg. 4- Move as quickly as possible to the platform and load it by extending over your hips, knees and ankles to place it as high as possible.\r\n  5- Return to the starting position to retrieve the next drum and repeat until the event is complete.\r\n\r\n', '- To load the drums, place the desired number at a distance from the loading platform, usually 30 to 50 feet . - The higher you can place the drum, the faster you should be able to move to the platform. - The shoulder is generally not allowed.  '),
(47, 'Kipping Muscle Up', 'Lats', 'video/Kipping Muscle Up.mp4', 'frontend/img/Kipping Muscle Up.jpg', '1- Grasp the rings with a false grip, with the base of your palms on top of the rings.\r\n2- Start with a movement by swinging your legs slightly backwards.\r\n3- Counteract this by swinging your legs forward and upward, shaking your chin and chest back, pulling up with both arms as you do so.4- When you reach the upper position of the pull, pull the rings towards your armpits by rolling your shoulders forward, allowing your elbows to back directly behind you; this puts you in the right position to continue in the diving part of the movement.\r\n5- While maintaining control and stability, lie across the elbow to complete the movement; be careful when lowering to the ground.\r\n \r\n', NULL),
(48, 'Leg Press', 'Quadriceps', 'video/Leg Press.mp4', 'frontend/img/Leg Press.jpg', '1- Using a leg press, sit on the machine and place your legs on the platform directly in front of you in a medium foot position (shoulder width). \r\n2- Lower the safety bars that hold the weighted platform in place and press the platform until your legs are fully extended in front of you.\r\n3- Your torso and legs should form a perfect 90 degree angle; this will be your starting position.\r\n4- As you inhale, slowly lower the platform until your upper and lower legs form a 90-degree angle.\r\n5- By pushing mainly with the heels of the feet and using the quadriceps, return to the starting position by exhaling.\r\n6- Repeat for the recommended number of repeats and make sure to lock the safety pins when you are finished; you do not want this platform to fall on you at full load.', '- for the purposes of this discussion, we will use the average position described above which targets overall development; however, you can choose one of the three positions described in the section on foot positioning.\r\n- Be sure not to block your knees . '),
(49, 'Leverage High Row', 'Middle Back', 'video/Leverage High Row.mp4', 'frontend/img/Leverage High Row.jpg', '1- Load the proper weight on the pins and adjust the seat height to reach the handles above you.2- Adjust the knee pad to help you stay on the ground.3- Grip the handles with pronation; This will be your starting position.\r\n 4- Pull the handles towards your torso, retracting your shoulder blades as you bend your elbow.\r\n 5- Pause at the bottom of the movement, then slowly move the handles back to the starting position.\r\n', '- For multiple repetitions, avoid completely putting the weight back on the stops to maintain tension on the muscles being used.'),
(50, 'Leverage Iso Row', 'Lats', 'video/Leverage Iso Row.mp4', 'frontend/img/Leverage Iso Row.jpg', '1- Load appropriate weight on the pins and adjust the seat height so that the handles are at chest level.  2- Grab the handles with a neutral or prone grip; this will be your starting position.\r\n3- Pull the handles towards your torso, retracting your shoulder blades as you bend your elbow.\r\n4- Pause at the bottom of the movement, then slowly return the handles to the starting position.5- For multiple repetitions, avoid completely reversing the weight at stops to maintain tension on the muscles during work.', NULL),
(51, 'Lying T-Bar Row', 'Middle Back', 'video/Lying T-Bar Row.mp4', 'frontend/img/Lying T-Bar Row.jpg', '1- Load the T-bar rower with the desired weight and adjust the leg height so that the top of your chest is at the top of the cushion.\r\n  2- Lie face down on the mat and grasp the handles; you can either use the palms down, palms up or palms in position depending on which part of your back you want to highlight.\r\n  3- Lift the support bar and extend your arms in front of you; this will be your starting position.\r\n  4- When exhaling, slowly pull the weight upward and tighten your back at the top of the movement.\r\n  5- After a second contraction at the top of the movement, inhaling, slowly descend to the starting position.\r\n  6- Repeat for the recommended amount of repetitions.', '- In some machines, all you can do is stand on the proper step that allows you to be at a height that has the upper chest at the top of the cushion.\r\n- Keep the upper arms as close as possible to the torso throughout the movement to better strain the back muscles. \r\n- Also, do not lift your body from the cushion at any time and avoid using biceps to lift the weight.'),
(52, 'Machine Bicep Curl', 'Biceps', 'video/Machine Bicep Curl.mp4', 'frontend/img/Machine Bicep Curl.jpg', '1- Adjust the seat to the appropriate height and make your weight selection.2- Place your arms against the pads and grasp the handles; this will be your starting position.\r\n 3- Perform the movement by bending the elbow, pulling your lower arm towards your upper arm.\r\n4- Pause at the top of the movement, then slowly bring the weight back to the starting position.\r\n5- Avoid reducing the weight to the stop until the series is complete to maintain tension on the muscles worked.', NULL),
(53, 'Man Maker', 'Middle Back', 'video/Man Maker.mp4', 'frontend/img/Man Maker.jpg', ' 1- Place a pair of dumbbells in front of you, parallel to each other. Keeping your back flat, lean forward and crouch down while grasping the dumbbells; this is your starting position.\r\n 2- Initiate the movement by kicking back one leg and then the other so that you are in a push-up position, holding on to the dumbbells; your weight should rest on your toes and hands. Make a row with one arm on each side, raising the elbow as high as possible.\r\n 3- Jump your feet forward and get up by cleaning the weights, bringing them to shoulder level, with your palms facing forward when you jump a second time.4- Go down a squat and go up in an explosive way, then press the weights at-top of the head until the arms are fully extended.\r\n 5- Lower the dumbbells on your shoulders, then crouch down to bring the weights back to the floor in front of you.6- Repeat for repetitions.', NULL),
(54, 'Middle Back Shrug', 'Middle Back', 'video/Middle Back Shrug.mp4', 'frontend/img/Middle Back Shrug.jpg', '1- Lie face down on an inclined bench holding a dumbbell in each hand; Your arms must be fully extended, suspended and pointed towards the ground; The palms of your hands must face each other; this will be your starting position.\r\n 2- When you exhale, tighten your shoulder blades together and hold the contraction for an entire second.\r\n     \r\n    \r\n     3- Repeat for the recommended amount of repetitions.', '- This movement is like the reverse action of a hug, or trying to perform rear laterals as if you had no arms. Inhaling, return to the starting position.'),
(55, 'Mixed Grip Chin', 'Middle Back', 'video/Mixed Grip Chin.mp4', 'frontend/img/Mixed Grip Chin.jpg', '1- Using a spacing about 1 inch wider than shoulder width, grasp a pull bar with palms facing forward and palms facing towards you. This will be your starting position.\r\n 2- Now, start getting up as you exhale.\r\n\r\n     \r\n 3- After a second contraction at the top, start descending slowly while inhaling.\r\n 4- Repeat for the recommended amount of repetitions.\r\n 5- On the next tray, change the grip; so if you had your right hand with your palms facing towards you and your left hand with your palms facing forward, on the next series you will have the palms facing forward for the right hand and facing you for the left.', '- With your arm with your palms facing up, focus on using your back muscles for movement. - This arm elbow should stay close to the torso. - With the other arm facing forward, the elbows will be spread but aligned with the torso. - You will focus on using lats to pull your body up.'),
(56, 'Muscle Up', 'Lats', 'video/Muscle Up.mp4', 'frontend/img/Muscle Up.jpg', '1- Grasp the rings with a false grip, with the base of your palms on top of the rings. Initiate upward pull by pulling the elbows down to the side, bending the elbows.\r\n2- When you reach the upper position of the pull, pull the rings towards your armpits by rolling your shoulders forward, allowing your elbows to back directly behind you; This puts you in the right position to continue in the diving part of the movement.\r\n3- Maintain control and stability; lie across the elbow to complete the movement; be careful when lowering to the ground.\r\n\r\n', NULL),
(57, 'Neck Press', 'Chest', 'video/Neck Press.mp4', 'frontend/img/Neck Press.jpg', '1- Lie down on a flat bench.2- Using a medium-wide handle (a handle that creates a 90-degree angle in the middle of the movement between the forearms and upper arms), lift the support bar and hold it straight on your neck with your arms locked; This will be your starting position.\r\n3- As you inhale, slowly descend until you feel the bar on your neck.\r\n4- After a second pause, bring the bar back to the start position while you exhale and push the bar using your chest muscles.5- Lock your arms and squeeze your chest into the contracted position, hold for one second, Then start coming down again slowly.\r\n6- Repeat the movement for the prescribed number of repetitions.\r\n7- When finished, put the bar back in the rack.', '- it takes at least twice as long to go down than to go up.'),
(58, 'Olympic Squat', 'Quadriceps', 'video/Olympic Squat.mp4', 'frontend/img/Olympic Squat.jpg', '1- Start with a bar on top of the traps; chest should be raised and head facing forward. 2- Adopt a hip width position with your feet turned as needed.\r\n 3- Lower your knees while bending your knees, avoiding as much as possible moving your hips back; this requires your knees to move forward; make sure they stay in line with your feet; the goal is to keep your torso as straight as possible.4- Continue along keeping the weight on the front of the heel.\r\n 5- As the upper legs come into contact with the lower legs, reverse the movement, causing the weight to rise.', NULL);
INSERT INTO `exercices` (`id`, `name`, `focus`, `video`, `images`, `description`, `conseil`) VALUES
(59, 'One-Arm Side Laterals', 'Shoulders', 'video/One-Arm Side Laterals.mp4', 'frontend/img/One-Arm Side Laterals.jpg', '1- Choose a dumbbell and place it in one of your hands; Your non-relevant hand should be used to grab something stable, such as a reclining machine.2- Lean towards your lifting arm and away from the hand gripping the tilted bench as this will keep you in balance.\r\n3- Stand with a straight torso and have the dumbbells at your side at arm’s length with the palm of your hand facing you; this will be your starting position.\r\n4- While holding the torso still (no swinging), lift the dumbbells to the side with a slight bending of the elbow and your hand slightly tilted forward as if you were pouring water into a glass.5- Continue climbing until your arm is parallel to the ground.6- Exhale while you perform this movement and pause for a second at the top.\r\n7- Slowly lower the dumbbells to the starting position while inhaling.\r\n8-Repeat for the recommended amount of repetitions.\r\n9- Switch arms and repeat.', NULL),
(60, 'Parallel Bar Dip', 'Triceps', 'video/Parallel Bar Dip.mp4', 'frontend/img/Parallel Bar Dip.jpg', '1- Stand between a set of parallel bars. Place one hand on each bar, then make a small jump to help you get into the starting position with your arms locked.\r\n2- Start by bending your elbow, lowering your body until your arms break at 90 degrees.3- Avoid swinging and maintain good posture throughout the descent.\r\n4- Reverse the motion by extending the elbow, pushing yourself back into the starting position.\r\n5- Repeat for the desired number of repetitions.', NULL),
(61, 'Pendlay Rown', 'Middle Back', 'video/Pendlay Rown.mp4', 'frontend/img/Pendlay Rown.jpg', ' 1- Start each repetition with the bar on the ground.2- Take a medium pronation on the bar right in front of you. Your torso should be parallel to the ground with your lower back arched and your knees partially bent.\r\n 3- Start with your extended shoulders and partially flexed thoracic spine; your cervical spine should be neutral; this will be your starting position.\r\n 4- Start pulling by extending your thoracic spine as you bend your elbow, trying to pull the weight into your abdomen as quickly as possible.5- Focus on the contraction of your shoulders as you retract your shoulder blades; there should be no movement at the hips or knees and a strict technique should be used.\r\n 6- Bring the weight to the ground between repetitions.', NULL),
(62, 'Plank', 'Abdominals', 'video/Plank.mp4', 'frontend/img/Plank.jpg', '1- Lie down on the floor, holding your weight on your toes and forearms; your arms are bent and directly under the shoulder.\r\n2- Keep your body straight at all times and maintain this position for as long as possible. 3- To increase difficulty, an arm or leg can be raised.', NULL),
(63, 'Plate Twist', 'Abdominals', 'video/Plate Twist.mp4', 'frontend/img/Plate Twist.jpg', '1- Lie down on the floor or on an exercise mat with your legs fully extended and your upper body straight. 2- Grasp the plate by its sides with both hands in front of your abs with your arms slightly bent.\r\n 3- Slowly cross your legs near your ankles and lift them off the ground; your knees should also be slightly bent. \r\n\r\n 4- Move the plate to the left and touch the floor with; Exhale as you perform this movement.\r\n 5- Inhale back to the starting position and repeat the movement, this time on the right side of the body. \r\n \r\n  6-Repeat for the recommended amount of repetitions.', '-  Move your upper body slightly backwards to help you maintain balance by turning this exercise.\r\n\r\n-  Always use a slow, controlled movement. Jerky movements can injure the back.'),
(64, 'Power Clean', 'Hamstrings', 'video/Power Clean.mp4', 'frontend/img/Power Clean.jpg', '1- Stand with feet slightly wider than shoulder width and toes slightly forward.\r\n2- Crouch and grasp the bar with a closed pronation grip; your hands should be slightly wider than the shoulder width outside the knees with the elbows fully extended.\r\n3- Place the bar about 1 inch in front of your shins and above the soles of your feet; your back should be flat or slightly arched, your chest raised and curved and your shoulder blades should be retracted.\r\n4- Keep your head in a neutral position (aligned with the spine and not tilted or rotated) with your eyes fixed straight ahead.5- Inhale during this phase.', NULL),
(65, 'Power Partials', 'Shoulders', 'video/Power Partials.mp4', 'frontend/img/Power Partials.jpg', '1- Stand with your right torso and a dumbbell in each hand held at arm’s length; Elbows should be close to the torso; Palms of hands should face your torso. Your feet should be about shoulder width apart; this will be your starting position.\r\n 2- With arms straight and torso still, lift the weights on the sides until they are about shoulder level while exhaling.\r\n 3- Feel the contraction for a second and start lowering the weights to the starting position while inhaling.\r\n4- Repeat for the recommended amount of repetitions.', '-  Keep palms down with your little finger slightly higher while lifting and lowering weights as this will mainly focus stress on your shoulders.'),
(66, 'Power Snatch', 'Hamstrings', 'video/Power Snatch.mp4', 'frontend/img/Power Snatch.jpg', '1- Start with a loaded bar on the floor; the bar should be close or touching the shins, and a wide grip should be taken on the bar; Feet should be directly under the hips, feet turned as needed.2- Lower the hips, chest up and head forward; shoulders must be just in front of the bar; this will be the starting position.\r\n 3- Start the first pull through the front of the heels, lifting the bar off the ground; the angle of the back must remain the same until the bar exceeds the knees.\r\n 4- Move to the second pull by extending the hips, knees and ankles, raising the bar as quickly as possible. The bar should be close to the body; At the top of the extension, shrug your shoulders and let your elbows bend to the side.\r\n 5- When you move your feet into the landing position, a slightly wider position, pull under the bar while raising the bar above your head; the bar must be received in partial squat.6- Continue raising the bar to the-up positiontop of the head, receiving the locked bar above the head.\r\n7- Return to standing position with the weight above the head.', NULL),
(67, 'Preacher Curl', 'Biceps', 'video/Preacher Curl.mp4', 'frontend/img/Preacher Curl.jpg', 'To perform this movement, you will need a preacher’s bench and an E-Z:. 1- Grasp the E-Z curl bar at the closed inside handle. 2- The palm of your hands should be facing forward and slightly inward because of the shape of the bar.\r\n 3- With the upper arms positioned against the preacher’s bench cushion and chest against it, hold the E-Z Curl bar at shoulder length; this will be your starting position.\r\n 4- While inhaling, slowly lower the bar until your arm is extended and the biceps is fully stretched.\r\n 5- When exhaling, use the biceps to roll the weight until your biceps are fully squeezed and the bar is at shoulder height.6- Tighten the biceps hard and hold this position for a second.\r\n7- Repeat for the recommended amount of repetitions.', '- ask someone to put the bar back on, which is preferable, or grab the bar on the front bar provided by most preacher benches.'),
(68, 'Pullups', 'Lats', 'video/Pullups.mp4', 'frontend/img/Pullups.jpg', '1- Grasp the pull bar with the palms facing forward using the prescribed handle. \r\n2- As you have both arms outstretched in front of you while holding the bar at the chosen handle width, bring your torso back about 30 degrees while creating a curvature on the bottom of your back and pulling out your chest; this is your starting position.3- Pull your torso up until the bar touches the top of your chest by pulling the shoulders and upper arms down and back; exhale as you perform this part of the movement.  \r\n  \r\n4- After one second in the contracted position, start inhaling and slowly lower your torso to the starting position when your arms are fully extended and the lats are fully stretched. \r\n5- Repeat this motion for the prescribed number of repetitions.\r\n\r\n \r\n', ' - Focus on compression of the back muscles once you have reached the full contracted position. - The upper torso should remain stationary when moving through space and only the arms should move. - Forearms should not do anything other than hold the bar.\r\n-  Handles note: For a wide grip, your hands should be spaced wider than the width of your shoulders; For a medium grip, your hands should be spaced at a distance equal to the width of your shoulders and for a close grip at a distance less than the width of your shoulders.'),
(69, 'Push Press', 'Shoulders', 'video/Push Press.mp4', 'frontend/img/Push Press.jpg', '* Starting position:1- Use the floor-shoulder lifting technique described in Power Clean to move the bar from the floor towards the shoulders.2- up by extending the knees. Keep the torso straight and tight; With maximum extension of the hip and knee, transfer the weight of the body to the soles of the feet and extend the ankle joints . 3- At maximum plantar flexion, push the bar from the shoulders . 4- Push the bar with the arms to a fully extended elbow position above the head. * Downward movement phase:5- lower the bar to the shoulders.6- Slightly bend the hips and knees when the bar touches the shoulders.7- Straighten the hips and knees before the upward movement phase begins again. * Breath:8- exhale through the Up Motion Phase Block.9- Inhale during the Down Movement Phase .', NULL),
(70, 'Pushups', 'Chest', 'video/Pushups.mp4', 'frontend/img/Pushups.jpg', '1- Lie on the floor face down and place your hands approximately 36 inches while holding your torso at arm’s length.\r\n2- Then lower yourself until your chest almost touches the ground when you inhale.\r\n3- Now exhale and press on the top of your body to return to the starting position while squeezing your chest.\r\n4- After a brief pause in the upper contracted position, you can start lowering down again for as many repetitions as necessary.', NULL),
(71, 'Rack Pull with Bands', 'Lower Back', 'video/Rack Pull with Bands.mp4', 'frontend/img/Rack Pull with Bands.jpg', '1- Install yourself in a power rack with the bar on the pins. 2- The pins should be adjusted to the desired point; just below the knees, just above or half-thigh. 3- Attach strips to the base of the rack or attach them with dumbbells. 4- Attach the other end to the bar. You may need to smother the tapes to provide tension.\r\n   5- Position yourself against the bar in an appropriate ground lift position. 6- Your feet should be under your hips, shoulder width, arched back and hips back to engage the hamstrings. \r\n  7- With your head facing forward, lie across your hips and knees, pulling the weight up and back to the lock. 8- Be sure to pull your shoulders back when you finish the movement. 9- Put the weight back on the pins and repeat. \r\n \r\n', '- Because the weight is usually heavy, you can use a mixed handle, a hook handle or straps to help maintain the weight.'),
(72, 'Rack Pulls', 'Lower Back', 'video/Rack Pulls.mp4', 'frontend/img/Rack Pulls.jpg', ' 1- Install yourself in a power rack with the bar on the pins; the pins must be adjusted to the desired point; just below the knees, just above or half thigh. 2- Position yourself against the bar in an appropriate raising position; your feet should be under your hips, shoulder width, arched back and hips back to engage the hamstrings.\r\n 3- With your head facing forward, lie across your hips and knees, pulling the weight up and back to lock. 4- Be sure to pull your shoulders back when you finish the movement. \r\n5- Put the weight back on the pins and repeat. \r\n\r\n\r\n', '- Because the weight is usually heavy, you can use a mixed handle, a hook handle or straps to help maintain the weight.'),
(73, 'Reverse Cable Curl', 'Biceps', 'video/Reverse Cable Curl.mp4', 'frontend/img/Reverse Cable Curl.jpg', ' 1- Stand with your torso straight while holding a bar attachment that is attached to a pulley using pronation (palms down) and shoulder width.2- Also make sure you keep your elbows close to the torso. This will be your starting position.\r\n 3- While holding the upper arms still, bend the weights while contracting the biceps when you exhale; only the forearms should move. 4- Continue the movement until your biceps are completely contracted and the bar is at shoulder level.5- Hold the contracted position for a second while you tighten the muscle.\r\n 6- Slowly begin to bring the bar back to its starting position as you inhale.\r\n 7- Repeat for the recommended amount of repetitions.', ''),
(74, 'Reverse Flyes', 'Shoulders', 'video/Reverse Flyes.mp4', 'frontend/img/Reverse Flyes.jpg', '1- To start, lie down on an inclined bench with your chest and stomach against the slope.2- Have the dumbbells in each hand with your palms facing each other (neutral grip).\r\n3-  Extend your arms in front of you so that they are perpendicular to the corner of the bench; legs should be stationary while applying pressure with the soles of the toes; this is the starting position.\r\n4- Keeping the elbows slightly bent, move the weights away from each other (to the side) in an arc motion while exhaling.\r\n 5- Feel the contraction and slowly lower the weights to the starting position while inhaling.\r\n 6- Repeat for the recommended amount of repetitions.', '- Try to tighten your shoulder blades together to get the best results from this exercise.\r\n- Arms should be raised until parallel to the ground.'),
(75, 'Ring Dips', 'Triceps', 'video/Ring Dips.mp4', 'frontend/img/Ring Dips.jpg', '1- Grab a ring in each hand, then make a small jump to help you get into the starting position with your arms locked.\r\n2- Start by bending your elbow, lowering your body until your arms break at 90 degrees.3- Avoid swinging and maintain good posture throughout the descent.\r\n4- Reverse the motion by extending the elbow, pushing yourself back into the starting position.\r\n5- Repeat for the desired number of repetitions.', NULL),
(76, 'Rope Climb', 'Lats', 'video/Rope Climb.mp4', 'frontend/img/Rope Climb.jpg', '1- Grab the rope with both hands above your head; pull on the rope as you make a small jump.\r\n2- Wrap the rope around one leg, using your feet to pinch the rope; Reach out as high as you can with your arms, holding the rope firmly.\r\n3- Release the rope from your feet as you lift up with your arms, bringing your knees to your chest.\r\n4- Put your feet back on the rope, then stand up to take another high hold on the rope; Continue until you reach the top of the rope.\r\n5- To lower yourself, loosen the grip of your feet on the rope as you slide down using a hand-to-hand motion.', NULL),
(77, 'Seated Triceps Press', 'Triceps', 'video/Seated Triceps Press.mp4', 'frontend/img/Seated Triceps Press.jpg', '1- Sit on a bench with back support and grab a dumbbell with both hands and hold it over your head at arm’s length; this will be your starting position.\r\n2- Keeping your upper arms close to your head (elbows in) and perpendicular to the floor, lower the resistance in a semi-circular motion behind your head until your forearms touch your biceps.\r\n3- Inhale as you complete this step.\r\n4- Return to the starting position by using the triceps to lift the dumbbells; exhale as you perform this step.\r\n5- Repeat for the recommended amount of repetitions.', '- the best is to be handed over by someone, especially if they are very heavy.\r\n- Resistance should rest in the palm of your hands with your thumbs around.\r\n- The palm of the hand should be facing inward.\r\n- Upper arms should remain stationary and only forearms should move.'),
(78, 'Shotgun Row', 'Lats', 'video/Shotgun Row.mp4', 'frontend/img/Shotgun Row.jpg', '1- Attach a single handle to a low cable.\r\n2- After selecting the correct weight, stand a few feet back with a widely divided position. Your arm should be extended and your shoulder forward; this will be your starting position.\r\n3- Move by retracting the shoulder and bending the elbow; As you pull, supine the wrist, turning the palm upwards as you go.\r\n4- After a brief pause, return to the starting position.', NULL),
(79, 'Snatch', 'Quadriceps', 'video/Snatch.mp4', 'frontend/img/Snatch.jpg', '1- Place your feet shoulder width apart with the bar resting just above the connection between your toes and the rest of your foot.\r\n  2- With a palm grip down, bend your knees and keep your back flat, grasp the bar using a grip wider than shoulder width.3- Lower your hips and make sure your body falls as if you were going to sit on a chair; This will be your starting position.\r\n  4- Start pushing the floor as if it were a moving platform with your feet and simultaneously start lifting the bar by keeping it close to your legs.\r\n  5- When the bar reaches the middle of your thighs, push the floor with your legs and lift your body to full extension in an explosive motion.\r\n  6- Lift your shoulders back in a shrug while raising the bar while raising your elbows to the side and keeping them above the bar as long as possible.\r\n  7- Now, in a very fast but powerful movement, you need to place your body under the bar when it has reached a sufficiently high point where it can be controlled and fall while locking your arms and holding the bar at -over your head when you are crouching.\r\n  8- Complete the movement by exiting the squat position to complete the movement; At the end of the lift, both feet should be aligned and arms fully extended holding the bar above the head.', NULL),
(80, 'Spell Caster', 'Abdominals', 'video/Spell Caster.mp4', 'frontend/img/Spell Caster.jpg', '1- Hold a dumbbell in each hand with pronation; your feet should be wide with your hips and knees extended; this will be your starting position.\r\n2- Start the movement by pulling the two dumbbells to one side next to your hip, turning your torso.\r\n3- Keeping arms and dumbbells parallel to the floor, rotate your torso to swing the weights to your opposite side.\r\n4- Continue alternating, turning from side to side until the set is complete.', NULL),
(81, 'Spider Crawl', 'Abdominals', 'video/Spider Crawl.mp4', 'frontend/img/Spider Crawl.jpg', '1- Start in a lying position on the ground. 2- Place your weight on your hands and toes, feet together and body straight; your arms should be bent 90 degrees; this will be your starting position.\r\n3- Start the movement by lifting one foot off the ground. 4- Rotate the leg outward and bring the knee to your elbow as far forward as possible.\r\n5- Return this leg to the starting position and repeat on the opposite side.', NULL),
(82, 'Spider Curl', 'Biceps', 'video/Spider Curl.mp4', 'frontend/img/Spider Curl.jpg', ' 1- Start by placing the bar on the part of the preacher’s bench that you normally sit on.2- Make sure you align the bar correctly so that it is balanced and does not fall.\r\n 3- Move to the front of the preacher’s bench (the part where the arms usually rest) and position yourself to lie at 45 degrees, with your torso and belly leaning against the front of the preacher’s bench.\r\n4- Make sure your feet (especially toes) are well positioned on the floor and place your arms on top of the cushion inside the preacher’s bench.\r\n5- Use your arms to grasp the bar with a supine grip (palms up) about shoulder width apart or slightly closer to each other.\r\n6- Slowly start lifting the bar up and exhaling; Hold the contracted position for one second while tightening the biceps.\r\n7- Slowly begin to bring the bar back to the starting position while you inhale.\r\n8- Repeat for the recommended amount of repetitions.', NULL),
(83, 'Sumo Deadlift', 'Hamstrings', 'video/Sumo Deadlift.mp4', 'frontend/img/Sumo Deadlift.jpg', '1- Start with a loaded bar on the ground.2- Approach the bar so that the bar crosses the middle of the feet; Feet must be very wide, near the necks.3- Bend the hips to grasp the bar; Arms must be directly under the shoulders, inside the legs, and you can use a pronation grip, a mixed grip or a hook grip.4- Relax the shoulders, which has the effect of lengthening your arms.\r\n 5- Breathe, then lower your hips, looking forward with your head with your chest up.6- Cross the ground spreading your feet, with your weight on the back half of your feet.7- Lie across your hips and knees; When the bar passes through your knees, lean back and push your hips into the bar, bringing your shoulder blades closer.\r\n8- Bring the weight to the ground by bending the hips and controlling the weight as you descend.', NULL),
(84, 'Suspended Row', 'Middle Back', 'video/Suspended Row.mp4', 'frontend/img/Suspended Row.jpg', ' 1- Hang your straps around the height of your chest.2- Hold a handle in each hand and lean back.3- Keep your body straight and your head and chest up; your arms should be fully extended; this will be your starting position.\r\n 4- Start by bending your elbow to initiate movement.5- Extend your shoulder blades while you are doing it.\r\n 6- At the end of the movement, pause and return to the starting position.', NULL),
(85, 'T-Bar Row', 'Middle Back', 'video/T-Bar Row.mp4', 'frontend/img/T-Bar Row.jpg', '1- Load the bar at a weight appropriate for your workout.2- Stand with your feet on the bar and bend your hips to grip the pronation handles.\r\n 3- Make sure your back stays flat, then remove the weight from the supports, letting the bar hang at arm’s length; this will be your starting position.\r\n 4- Perform the movement by bending the elbows and retracting the shoulder blades, pulling the weight towards your chest.\r\n 5- After a brief pause at the top of the movement, return to the starting position.', NULL),
(86, 'Tire Flip', 'Quadriceps', 'video/Tire Flip.mp4', 'frontend/img/Tire Flip.jpg', '1- Start by grasping the bottom of the tire on the tread and place your feet a little back; your chest should sink into the tire.\r\n 2- To lift the tire, lie across the hips, knees and ankles, entering the tire and up.\r\n3- When the tire reaches a 45 degree angle, move forward and push a knee into the tire. In doing so, adjust your grip to the top of the tire and push it forward as hard as possible to complete the turn.4- Repeat if necessary.', NULL),
(87, 'Triceps Pushdown', 'Triceps', 'video/Triceps Pushdown.mp4', 'frontend/img/Triceps Pushdown.jpg', '1- Attach a straight or bent bar to a high pulley and grab it with pronation (palms down) shoulder width apart.\r\n2- Standing with the right torso and a very small forward tilt, bring the upper arms close to your body and perpendicular to the floor; the forearms should point towards the pulley when holding the bar; this is your starting position.\r\n3- Using the triceps, lower the bar until it touches the front of your thighs and the arms are fully extended perpendicular to the floor; the upper arms should always stand still beside your torso and only the forearms should move. Exhale while performing this movement.\r\n4- After a second press down position, slowly pull the bar back to the starting point; Inhale as you perform this step.\r\n5- Repeat for the recommended amount of repetitions.', NULL),
(88, 'V-Bar Pulldown', 'Lats', 'video/V-Bar Pulldown.mp4', 'frontend/img/V-Bar Pulldown.jpg', '1- Sit on a roll-down machine with a V-bar attached to the top pulley.\r\n2- Adjust the machine knee pad to suit your height; these pads will prevent your body from being lifted by the resistance attached to the bar.\r\n3- Grasp the V-bar with palms facing each other (a neutral grip). 4- Pull out your chest and lean back slightly (about 30 degrees) to better engage the lats; this will be your starting position.5- Using your slats, pull the bar down while tightening your shoulder blades.6- Continue until your chest almost touches the V-bar.  Exhale as you perform this movement. \r\n  \r\n After a second release to the contracted position, slowly bring the bar back to the starting position while inhaling.\r\n Repeat for the prescribed number of repetitions.\r\n\r\n', '- Keep the torso still throughout the movement.'),
(89, 'V-Bar Pullup', 'Lats', 'video/V-Bar Pullup.mp4\r\n', 'frontend/img/V-Bar Pullup.jpg', '1- Start by placing the middle of the V-bar in the middle of the pull bar (assuming the pull station you are using does not have neutral grips) ; V-Bar handles will be facing down so that you can hang onto the pull bar through the use of the handles.\r\n2- Once you have correctly placed the V-bar, grab the bar on each side and hang it.3- Pull out your chest and lean back slightly to better engage the lats; this will be your starting position.\r\n4- Using your lats, pull your torso up while leaning your head slightly back so as not to hit you with the chin bar.5- Continue until your chest almost touches the V-bar; exhale as you perform this movement.\r\n6- After a second hold, slowly lower your body to the starting position as you inhale.\r\n7- Repeat for the prescribed number of repetitions.\r\n', NULL),
(90, 'Weighted Bench Dip', 'Triceps', 'video/Weighted Bench Dip.mp4', 'frontend/img/Weighted Bench Dip.jpg', ' For this exercise, you will need to place one bench behind your back and one in front of you: \r\n1- With benches perpendicular to your body, stand at a bench on its edge with your hands close to your body, separated shoulder width apart; your arms must be fully extended.\r\n2- The legs will be extended forward above the other bench; your legs should be parallel to the floor while your torso should be perpendicular to the floor.3- Have your partner place the dumbbells on your lap; this will be your starting position.\r\n3- Slowly lower your body as you inhale, bending your elbows until you are down enough to have a slightly less than 90 degree angle between the upper arm and forearm.\r\n4- Using your triceps to pull up your torso, return to the starting position while exhaling.\r\n5- Repeat for the recommended amount of repetitions.', '- This exercise is best done with a partner as placing the weight on your lap can be difficult and can cause injuries without assistance.\r\n- Keep elbows as close as possible throughout the movement.\r\n- Forearms should always point down.\r\n'),
(91, 'Zottman Curl', 'Biceps', 'video/Zottman Curl.mp4', 'frontend/img/Zottman Curl.jpg', '1- Stand with your right torso and dumbbell in each hand held at arm’s length; elbows should be close to the torso.\r\n2- Make sure the palms of your hands face each other. This will be your starting position.\r\n3- While holding the upper arm still, bend the weights while contracting the biceps when exhaling; Only the forearms should move; Your wrist should rotate to have a supination grip (palms up). 4- Continue the movement until your biceps are completely contracted and the dumbbells are at shoulder level.\r\n5- Hold the position for one second while tightening the biceps.\r\n6- Now, during the contracted position, rotate your wrist until you now have a pronation grip (palms down) with the thumb at a higher position than the pinky.\r\n7- Slowly start lowering dumbbells using pronation.\r\n8- As the dumbbells close your thighs, start turning the wrist back to a neutral grip (palms facing your body).\r\n9- Repeat for the recommended amount of repetitions.', NULL);
